import React, { ComponentType } from "react";
import styled from "styled-components";

type linkType = {
    href: string;
    className: string;
    children: string;
};

const Link: ComponentType<linkType> = ({ href, className, children }) => (
    <a href={href} className={className}>
        {children}
    </a>
);

export default Link;
